    def gencheck(self):      #ฟังชั่นไว้เจ็นค่าจากdatabase มาเป็นcheck box
        values=[]
        for i,v in enumerate(self.gridLayoutlist):
            self.cursor.execute("""SELECT [Value]
            FROM [BigTable]
            WHERE [FeatureName] =? AND [StationName]=? AND [PartName]=? AND  CAST(ObsTimestamp AS DATETIME) BETWEEN CONVERT(datetime,?) AND CONVERT(datetime,?)  ;""", (self.Featname[i], self.StationName,  self.PartName, str(self.datetime_start), str(self.datetime_end)))
            value1 = self.cursor.fetchall()
            value1 = [value1[0] for value1 in value1[0:len(value1)]]
           
            values.append(value1)      #ประกาศให้ทั้งคลาสเรียกใช้ค่าvalueทั้งหมดได้

            if self.Featname[i] != ' ':
                word='Select All'
                checkB =(QCheckBox(word,self)) 
                checkB.setStatusTip("Crawling best singals for "+word+"." ) # set Statusbar
                checkB.setChecked(True)
